        const itemsPerPage = 10;
        let currentPage = 1;

        // Get the output element from the HTML document
        const outputElement = document.getElementById("output");
        const searchInput = document.getElementById("searchInput");
        const paginationElement = document.getElementById("pagination");

        // Function to render products based on search input and current page
        function renderProducts(searchTerm, page) {
            const filteredData = originalData.filter(item => {
                return item.PartNumber.toLowerCase().includes(searchTerm.toLowerCase()) ||
                    item.ManufacturerName.toLowerCase().includes(searchTerm.toLowerCase()) ||
                    item.Description.toLowerCase().includes(searchTerm.toLowerCase());
            });

            const startIndex = (page - 1) * itemsPerPage;
            const endIndex = startIndex + itemsPerPage;
            const paginatedData = filteredData.slice(startIndex, endIndex);

            // Create HTML content using the paginated data
            let htmlContent = '';
            paginatedData.forEach(item => {
                htmlContent += `
                    <div class="diva">
                        <p>ID: ${item.Id}</p>
                        <p>Part Number: ${item.PartNumber}</p>
                        <p>Manufacturer Name: ${item.ManufacturerName}</p>
                        <p>Lead Time: ${item.LeadTime}</p>
                        <p>Min Order Quantity: ${item.MinOrderQuantity}</p>
                        <p>Standard Pack Quantity: ${item.StandardPackQuantity}</p>
                        <p>Stock Quantity: ${item.StockQuantity}</p>
                        <p>HTS: ${item.HTS}</p>
                        <p>UOM: ${item.UOM}</p>
                        <p>Rohs: ${item.Rohs}</p>
                        <p>ECCN: ${item.ECCN}</p>
                        <p>Data Sheet Link: <a href="${item.DataSheetLink}" target="_blank">${item.DataSheetLink}</a></p>
                        <p>Description: ${item.Description}</p>
                        <img src="${item.LargeImage}" alt="Product Image">
                        <br><br>
                        <a href="mailto:mailto:example@example.com" class="button">Request A Quote</a>
                    </div>
                    <hr>
                `;
            });

            // Set the innerHTML of the output element with the created HTML content
            outputElement.innerHTML = htmlContent;

            // Render pagination buttons
            renderPaginationButtons(filteredData.length);
        }

        // Function to render pagination buttons
        function renderPaginationButtons(totalItems) {
            const totalPages = Math.ceil(totalItems / itemsPerPage);

            let paginationHtml = '';
            for (let i = 1; i <= totalPages; i++) {
                paginationHtml += `<div class="page-link" onclick="changePage(${i})">${i}</div>`;
            }

            paginationElement.innerHTML = paginationHtml;

            // Set the active class to the current page button
            const pageButtons = document.querySelectorAll('.page-link');
            pageButtons.forEach(button => {
                button.classList.remove('active');
            });
            pageButtons[currentPage - 1].classList.add('active');
        }

        // Function to change the current page and re-render products
        function changePage(page) {
            currentPage = page;
            renderProducts(searchInput.value.trim(), currentPage);
        }

        // Event listener for input changes
        searchInput.addEventListener("input", function () {
            currentPage = 1; // Reset to first page when the search term changes
            renderProducts(searchInput.value.trim(), currentPage);
        });

        // Initial render without any search term
        renderProducts("", currentPage);
    </script>
